import logo from './logo.svg';
import './css/App.css';

function App() {
  return (
    <div className="App">
      <section class="section parallax bg1">
        <h1>AirPng</h1>
        <br/>
         <h1>Market your AirBnB </h1>
      </section>
      <section class="section static">
         <h1>Boring</h1>
      </section>
      <section class="section parallax bg2">
         <h1>Fluffy Kitten</h1>
      </section>
    </div>
  );
}

export default App;
